import { NavigationContainer } from '@react-navigation/native';
import { PaymentStackScreens } from './PaymentStack';

const Routes: React.FC = () => {
    return (
        <NavigationContainer>
            <PaymentStackScreens />
        </NavigationContainer>
    );
};

export default Routes;
